### ‚ñ† Your Discord ID

CyberGoblinGirl#8352

### ‚ñ† Dragon Survival version

DragonSurvival_DragonEditor-1.18.2-0.11.4_beta.jar

### ‚ñ† Single game or server?

Single (Default)

### ‚ñ† Do you delete old configs before writing a bug report?

Nope (Default)

### ‚ñ† Do you play pure MC + DS and Geckolib or do you have some kind of modpack?

I have other mods

### ‚ñ† Describe the bug

I left my cave nest to inspect an explosion sound (from my meteorites mod) started flying in circles and the game froze and crashed. I looked through the crash report and it looks like it had something to do with a Knight spawning in? i dont fully understand the coding language but it could probably be something else

### ‚ñ† To Reproduce

it happened everytime i tried to reload the world but i have no way of knowing if its repeatable
*Edit: i loaded a new world, summoned a knight and it didnt crash until i lit the knight on fire (as a dragon) but with a different error code, just a standard java runtime exception, but when i reloaded and summoned a new one I tried being a forest dragon, and attacked/killed it with no issues except a bit of lag. So i summoned another knight and got the exact same crash code as the one below. 

### ‚ñ† Expected behavior

I have no idea what the expected behavior should be in this situation, i guess that it should load properly without crashing?

